import React from 'react'
// import axios, { post } from 'axios';
import {
    Card,
    CardBody,
    CardTitle,
    Input,
} from 'reactstrap';
import { BrowserRouter, Link } from "react-router-dom";
// import { provideIntlService } from '@progress/kendo-react-intl';
// import { Calendar, CalendarCell, CalendarWeekCell, CalendarNavigationItem, CalendarHeaderTitle, DateInput, DatePicker, TimePicker, MultiViewCalendar, DateRangePicker, DateTimePicker } from '@progress/kendo-react-dateinputs'
// import '@progress/kendo-react-intl'
// import '@progress/kendo-react-tooltip'
// import '@progress/kendo-react-common'
// import '@progress/kendo-react-popup'
// import '@progress/kendo-react-buttons'
// import '@progress/kendo-date-math'
// import '@progress/kendo-react-dropdowns'
import Cal from './calender';

class Content extends React.Component {
	constructor(props) {
    super(props)
    this.state = {
      todos: []
    }; 
    // setTimeout(() => {
    //         const date = '2016-01-04';
    //         this.setState({ value: provideIntlService(this).parseDate(date) });
    //     }, 1000); 
  }
  async componentDidMount() {
    try {
      const res = await fetch('http://localhost:3000/members');
      const todos = await res.json();
      this.setState({
        todos
      });
    } 
    catch (e) {
      console.log(e);
    }
  }  

  // Simulate data retrieval from the server.


  render() {
    return (
    	<BrowserRouter>
	      <Card>
	        <CardBody>
	          <CardTitle>Feeds1</CardTitle>
	            <div>
	              {this.state.todos.map((item, i) => (
	                <div key={i}>
	                  <h1>{item.real_name}</h1>
	                  <Link to={`/Cal/${item.id}`}>{item.real_name}</Link>
	                </div>

	              ))}
	              <Switch>
              <Route exact path="/Cal" component={Cal} />

            </Switch>
	              <Cal/>
	            </div>
	        </CardBody>
	      </Card>
      </BrowserRouter>
    );
  }

}
export default Content
